import React from "react";

export default function Header(){
  return (
    <header className="site-header">
      <div className="container site-header__inner">
        <a href="#top" className="brand" style={{gap:14}}>
          {/* Если у тебя логотип .png, замени 'logo.jpg' на 'logo.png' */}
          <img
            src={process.env.PUBLIC_URL + "/logo.jpg"}
            alt="Логотип Вентагрегат"
            width="36"
            height="36"
            style={{borderRadius:6, objectFit:"cover", display:"block"}}
            onError={(e)=>{ e.currentTarget.style.display="none"; }}
          />
          <span style={{fontSize:20, fontWeight:700}}>Вентагрегат</span>
        </a>

        <nav className="nav">
          <a href="#hero">Производство</a>
          <a href="#prod">Продукция</a>
          <a href="#catalog">Прайс-листы</a>
          <a href="#contact">Контакты</a>
          <a href="tel:+71111111111">☎ (111) 111-1111</a>
        </nav>
      </div>
    </header>
  );
}
